import React from "react";
import "./App.css";
import Usuario from "./components/cadastroUsuario/index";
import Veiculo from "./components/cadastroVeiculo";
import Busca from "./components/buscaVeiculo";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <Link to="/usuario">Usuario</Link>
        <Link to={Veiculo}>Veiculo</Link>
        <Link to={Busca}>Buscar</Link>
      </div>

      <Routes>
        <Route path="/usuario" component={Usuario} />
        <Route path="/veiculo" component={Veiculo} />
        <Route path="/buscar" component={Busca} />
      </Routes>
    </Router>
  );
}

export default App;
